// src/pages/DashboardPage.js
import React, { useEffect, useState, useCallback } from "react";
import { useAuth } from "../context/AuthContext";
import apiService from "../services/api";
import { Button } from "../components/ui/button";
import { Card, CardContent } from "../components/ui/card";

const DashboardPage = () => {
  const { user, isAdmin } = useAuth();
  const [issues, setIssues] = useState([]);
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);

  // ✅ Memoized fetch function
  const fetchDashboardData = useCallback(async () => {
    try {
      if (isAdmin()) {
        const response = await apiService.admin.getDashboard();
        setIssues(response.data.issues || []);
        setStats(response.data.stats || null);
      } else {
        const response = await apiService.issues.getMyIssues();
        setIssues(response.data.issues || []);
      }
    } catch (error) {
      console.error("Failed to fetch dashboard data:", error);
    } finally {
      setLoading(false);
    }
  }, [isAdmin]);

  useEffect(() => {
    fetchDashboardData();
  }, [fetchDashboardData]);

  if (loading) return <p className="text-center mt-10">Loading...</p>;

  return (
    <div className="p-6 space-y-6">
      <h1 className="text-2xl font-bold">
        Welcome, {user?.name || "User"}
      </h1>

      {isAdmin() && stats && (
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <Card>
            <CardContent>
              <p className="text-gray-600">Total Issues</p>
              <h2 className="text-xl font-bold">{stats.totalIssues}</h2>
            </CardContent>
          </Card>
          <Card>
            <CardContent>
              <p className="text-gray-600">Resolved Issues</p>
              <h2 className="text-xl font-bold">{stats.resolvedIssues}</h2>
            </CardContent>
          </Card>
          <Card>
            <CardContent>
              <p className="text-gray-600">Pending Issues</p>
              <h2 className="text-xl font-bold">{stats.pendingIssues}</h2>
            </CardContent>
          </Card>
        </div>
      )}

      <div>
        <h2 className="text-lg font-semibold mb-3">
          {isAdmin() ? "All Issues" : "My Issues"}
        </h2>
        {issues.length === 0 ? (
          <p className="text-gray-500">No issues found.</p>
        ) : (
          <ul className="space-y-3">
            {issues.map((issue) => (
              <li
                key={issue._id}
                className="p-4 border rounded-lg flex justify-between items-center"
              >
                <div>
                  <h3 className="font-semibold">{issue.title}</h3>
                  <p className="text-sm text-gray-600">{issue.description}</p>
                </div>
                <span
                  className={`px-3 py-1 rounded-full text-sm ${
                    issue.status === "resolved"
                      ? "bg-green-200 text-green-800"
                      : "bg-yellow-200 text-yellow-800"
                  }`}
                >
                  {issue.status}
                </span>
              </li>
            ))}
          </ul>
        )}
      </div>

      {!isAdmin() && (
        <div className="mt-6">
          <Button onClick={() => alert("Navigate to issue form")}>
            Report New Issue
          </Button>
        </div>
      )}
    </div>
  );
};

export default DashboardPage;
